Let food be thy medicine, and let medicine be thy food.

When you feel like having a warm comforting drink, especially during winter, have you thought of Turmeric milk,  which is nowadays Glam-d up as a latte in coffee shops ?

Thousands of years before the western world recognized the anti-inflammatory and high-antioxidant properties of turmeric, it was a staple in Indian Kitchen.  Most Indian recipes call for a pinch of turmeric and to me it's a given to add turmeric just as I add salt to anything I cook.

A great immunity booster, Turmeric milk is a go to when one feels under the weather or when you want to keep fit, especially during the holiday season. 

Recipe
Bring to boil 2 cups milk or a vegan alternative 
Add and whisk till blended
1 tsp  organic turmeric powder or freshly grated root 
A pinch of pepper
Add
2 pieces of Star Anise for flavor 
2 tsp of honey for sweetening if needed
Continue to simmer for 5 minutes
Strain and serve warm
Alternatively, can use a cinnamon stick, grated fresh ginger, or ground cardamom in place of the Star Anise for additional flavor.

